import React from 'react'
import logo from './logo.svg';
import reactUuid from 'react/uuid'
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

class UUID extends React.Component {
  constructor(props) {
    super(props);

    this.new = this.new.bind(this)
  }

  new() {
    console.log("Generating new UUID...")
  }

  render() {
    return (
      <label>{reactUuid()}</label>
    );
  }
  // <button onclick={new}>
  //   Refresh
  // </button>
}


export default App;
